import './App.css';
import React from 'react';
import Navbar from './components/Navbar';
import { BrowserRouter as Router, Routes, Route  } from 'react-router-dom';

function App() {
  return (
    <>
    <Router>
      <Navbar />
        <Route path='/' exact component={Home}/> to <Route exact path="/" element={<Home />}/>
    </Router>
    </>
  );
}

export default App;
